import "./Items.css";
export default function Items({ items, addToCart }) {
  return (
    <>
      <section id="items">
        <div className="items">
          {items.map((value, key) => (
            <div className="item" key={value.id}>
              <a href="item">
                <img src={value.image} alt={value.category} />
              </a>
              <h2>{value.title}</h2>
              <h3>â‚ª {value.price.toFixed(2)}</h3>
              <div className="buttonsItem">
                <button
                  onClick={() => addToCart(value)}
                  className="item-add-cart"
                >
                  Add to Cart
                </button>
                <button className="item-buy-cart">Buy Now</button>
              </div>
            </div>
          ))}
        </div>
      </section>
      <button>Add items</button>
    </>
  );
}
